import { StyleSheet } from 'react-native';
import { colors } from './colors';
import { sizes } from './sizes';

export default StyleSheet.create({
  container1: {
    flex: 1,
    justifyContent: 'center',
  },
  container2: {
    flex: 1,
    justifyContent: 'center',
    width: '50%',
  },
  background: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
  },
  botao: {
    flex: 1,
  },
  img: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
    margin: 40,
  },
});
